inherent-impl → M impl-path type An inherent-impl indicates a path to an inherent implementation . It consists of the character M followed by an impl-path , which uniquely identifies the impl block the item is defined in. Following that is a type representing the Self type of the impl. Recommended Demangling An inherent-impl can be displayed as a qualified path segment to the type within angled brackets. The impl-path usually need not be displayed. Example: struct Example;
impl Example { fn foo() {}
} The symbol for foo in the impl for Example is: _RNvMs_Cs4Cv8Wi1oAIB_7mycrateNtB4_7Example3foo │├┘└─────────┬──────────┘└────┬──────┘ ││ │ │ ││ │ └── Self type "Example" ││ └─────────────────── path to the impl's parent "mycrate" │└─────────────────────────────── disambiguator 1 └──────────────────────────────── inherent-impl Recommended demangling: <mycrate::Example>::foo

