vendor-specific-suffix → (. | $) suffix suffix → { byte } The vendor-specific-suffix is an optional element at the end of the symbol-name . It consists of either a . or $ character followed by zero or more bytes. There are no restrictions on the characters following the period or dollar sign. This suffix is added as needed by the implementation. One example where this can happen is when locally unique names need to become globally unique. LLVM can append a .llvm.<numbers> suffix during LTO to ensure a unique name, and $ can be used for thread-local data on Mach-O. In these situations it's generally fine to ignore the suffix; the suffixed name has the same semantics as the original. Recommended Demangling The vendor-specific-suffix usually need not be displayed. Example: # use std::cell::RefCell;
thread_local! { pub static EXAMPLE: RefCell<u32> = RefCell::new(1);
} The symbol for EXAMPLE on macOS may have the following for thread-local data: _RNvNvNvCs7qp2U7fqm6G_7mycrate7EXAMPLE7___getit5___KEY$tlv$init └───┬───┘ │ └── vendor-specific-suffix Recommended demangling: mycrate::EXAMPLE::__getit::__KEY

