You can also modify the lint level with a crate-wide attribute: $ cat lib.rs
#![warn(missing_docs)] pub fn foo() {}
$ rustc lib.rs --crate-type=lib
warning: missing documentation for crate --> lib.rs:1:1 |
1 | / #![warn(missing_docs)]
2 | |
3 | | pub fn foo() {} | |_______________^ |
note: lint level defined here --> lib.rs:1:9 |
1 | #![warn(missing_docs)] | ^^^^^^^^^^^^ warning: missing documentation for a function --> lib.rs:3:1 |
3 | pub fn foo() {} | ^^^^^^^^^^^^ warn, allow, deny, and forbid all work this way. There is no way to set a lint to force-warn using an attribute. You can also pass in multiple lints per attribute: #![warn(missing_docs, unused_variables)] pub fn foo() {} And use multiple attributes together: #![warn(missing_docs)]
#![deny(unused_variables)] pub fn foo() {}

