Small no_std example is shown below. Applications using the standard library work as well. #![no_std]
#![no_main]
#![feature(lang_items)] // We must always link against libc, even if no external functions are used
// "extern C" - Block can be empty but must be present
#[link(name = "c")]
extern "C" { pub fn printf(format: *const core::ffi::c_char, ...) -> core::ffi::c_int;
} #[no_mangle]
pub extern "C" fn main(_argc: isize, _argv: *const *const u8) -> isize { const HELLO: &'static str = "Hello World, the answer is %d\n\0"; unsafe { printf(HELLO.as_ptr() as *const _, 42); } 0
} use core::panic::PanicInfo; #[panic_handler]
fn panic(_panic: &PanicInfo<'_>) -> ! { loop {}
} #[lang = "eh_personality"]
#[no_mangle]
pub extern "C" fn rust_eh_personality() {} The QNX Neutrino support of Rust has been tested with QNX Neutrino 7.0 and 7.1. There are no further known requirements.
